import React, {Component} from "react";
import Slider from '@mui/material/Slider';

class Home extends Component {

    marks = [
        {
            value: 0,
            label: '0°C',
        },
        {
            value: 20,
            label: '20°C',
        },
        {
            value: 37,
            label: '37°C',
        },
        {
            value: 100,
            label: '100°C',
        },
    ];

    valuetext(value) {
        return `${value}°C`;
    }

    render() {
        return(
            <div>
                <h1>Settings</h1>
                <p>Please choose your settings:</p>
                <Box sx={{ width: 300 }}>
                    <Slider
                        getAriaLabel={() => 'Temperature range'}
                        value={value}
                        onChange={handleChange}
                        valueLabelDisplay="auto"
                        getAriaValueText={valuetext}
                    />
                </Box>
            </div>
        )
    }
}

export default Home;
